css:
status-bar .latex-status.latex-highlight {
  color: #d7dae0;
}
status-bar .latex-status.latex-info {
  color: #6494ed;
}
status-bar .latex-status.latex-warning {
  color: #e2c08d;
}
status-bar .latex-status.latex-error {
  color: #ff6347;
}
status-bar .latex-status.latex-status-link {
  cursor: pointer;
}
status-bar .icon {
  text-align: center;
  display: inline-block;
}
status-bar .latex-spin {
  -webkit-animation: spin 2s infinite linear;
}
.latex-log .panel-body {
  margin-top: 5px;
  overflow-y: scroll;
}
.latex-log .panel-resize-handle {
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  height: 5px;
  cursor: row-resize;
  z-index: 3;
}
.latex-log .latex-info {
  border-left: 2px solid #0f82e6;
  padding-left: calc(0.5em - 2px);
}
.latex-log .latex-warning {
  border-left: 2px solid #ad7c0b;
  padding-left: calc(0.5em - 2px);
}
.latex-log .latex-error {
  border-left: 2px solid #d13b2e;
  padding-left: calc(0.5em - 2px);
}
.latex-log .latex-source-reference,
.latex-log .latex-log-reference {
  color: rgba(157, 165, 180, 0.6);
}
.latex-log .latex-source-reference::before {
  content: ' ';
}
.latex-log .latex-source-reference .latex-file-link::before {
  content: 'at ';
}
.latex-log .latex-line-number::before {
  content: ' at line ';
}
.latex-log .latex-end-line-number::before {
  content: '\2013';
}
.latex-log .latex-log-reference::before {
  content: ' [';
}
.latex-log .latex-log-reference::after {
  content: ']';
}
.latex-log .latex-log-reference .latex-file-link::before {
  content: 'from ';
}
.latex-log .latex-file-link {
  cursor: pointer;
}
.latex-log .latex-file-link:hover {
  text-decoration: underline;
}
.latex-log .latex-highlight {
  color: #d7dae0;
}
@-webkit-keyframes spin {
  from {
    -webkit-transform: rotate(0deg);
  }
  to {
    -webkit-transform: rotate(360deg);
  }
}
